import React from 'react';



const fakeProduct = {
    "id": "1",
    "name": "orange",
    "description": "orange description",
    "price": "100"
}

const Button = props => {
    return(
        <button onClcikAddToCart = {() => props.handleClickAddToCart(fakeProduct)} >
            Add To cart
        </button>
    )
}

export default Button;
